import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const HomeTab = () => {
    return (
        <View style={styles.Home_Tab}>
            <Text>HomeTab</Text>
        </View>
    );
}

const styles = StyleSheet.create({})

export default HomeTab;
